  larger than the standard domicile structure size. This includes all features greater
  than or equal to 500 square meters, and may include features less than 500 square
  meters. The geodatabase design is based on the USGS Best Practices File Template
  92v102.\",\n\t\"owner_org\": \"b0b4c45b-a8ca-416b-b463-ee90d0a1a3df\",\n\t\"extras\":
